  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field and enter 'team'
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'team');

    // Take screenshot after entering search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_input.png'));

    // Wait for the search button and click it
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Take screenshot after clicking search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Wait for the results to load (you may need to adjust the selector based on the actual results)
    await page.waitForSelector('.result-item'); // Assuming '.result-item' is a class for search results

    // Extract meaningful data to verify task completion
    const results = await page.$$eval('.result-item', items => items.map(item => item.textContent));

    return {
      success: true,
      action: "Searched for team-related events",
      extractedData: { results },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

